pragma solidity >=0.5.0 <0.6.0;
pragma experimental ABIEncoderV2;

contract Piper {
  address owner;
  string name;

  struct Extension_ {
    uint8 rating;
    uint256 reviews;
    uint256 downloads;
    uint256 updated;
    uint256 size;
    string hash;
    string developer;
    string developerETH;
    string name;
    string overview;
    string category;
    string version;
    string iconURL;
    string crx;
  }

  mapping(string => string) versions;
  mapping(string => address) developer;
  mapping(string => bool) hasExtension;

  constructor() public {
    owner = msg.sender;
    name = "Piper";
  }

  function isExtension(string memory _hash) public view returns(bool) {
    return hasExtension[_hash] == true;
  }

  event Extension(address, Extension_);
  event ExtensionVersion(string hash, string version, string crx);
  event ExtensionReview(uint256 rating, string hash, string review);

  function createNewExtension(string memory _hash, Extension_ memory _extension) public returns(bool) {
    // Creating a new extension.
    if (!isExtension(_hash)) {
      // Create new extension.
      versions[_hash] = _extension.version;
      developer[_hash] = msg.sender;
      hasExtension[_hash] = true;

      emit Extension(msg.sender, _extension);

      return true;
    } else {
      // Updating the extension.

      // Check if extension owner is the one trying to edit it.
      require(msg.sender == developer[_hash]);

      // Check whether they are updating the version.
      if (keccak256(bytes(_extension.version)) != keccak256(bytes(versions[_hash]))) {
        versions[_hash] = _extension.version;

        emit ExtensionVersion(_hash, _extension.version, _extension.crx);
      }

      emit Extension(msg.sender, _extension);

      return true;
    }
  }

  function addReview(uint256 _rating, string memory _hash, string memory _review) public returns(bool) {
    require (isExtension(_hash));

    emit ExtensionReview(_rating, _hash, _review);

    return true;
  }
}
